import '../../styles/Main.css';

function SearchForm() {
	return (
	    <div >
            <form className="searchForm">
                <input type="text" placeholder="Искать здесь..."/>
                <button type="submit"></button>
            </form>
        </div>
  	);
}

export default SearchForm;
